37.  THIRD PARTY IMBALANCE MANAGEMENT

Transporter shall allow Shippers to obtain imbalance management services from Third Party Providers in accordance with 18 C.F.R. 284.12(c) (2) (iii), subject to the following provisions regarding coordination between Transporter and any Third Party Provider:

37.1 The imbalance management services offered and provided by a Third Party Provider will be limited to balancing services for Shippers on Transporter's system.

37.2  Transporter will not allow a Third Party Provider to provide an imbalance management service that would cause either a Shipper(s) or Transporter to participate in an activity that is in violation of any other Section of Transporter's FERC Gas Tariff.

37.3 Transporter will not allow a Third Party Provider to provide a service which involves the resale and/or repackaging of an existing balancing service offered by Transporter if the resale and/or repackaging would create a greater obligation on Transporter or other Shippers than existed prior to the resale and/or repackaging.

37.4  Prior to offering Imbalance Management Services on Transporter's facilities, a Third Party Provider must provide Transporter with the following information:

(a) a clear definition of the operational changes the Third Party Provider will effectuate at points on Transporter's pipeline system in order to offset the operational effects on Transporter of imbalances and quantification of the extent to which such imbalances will be resolved through the provisions of Third Party Imbalance Management Service;

(b) a description of Transporter's facilities to be used by the Third Party Provider to effectuate the imbalance services, including the points of interconnect (delivery and/or receipt points) between Third Party's facilities and Transporter's pipeline system by which the Third Party Provider will effect changes on Transporter's pipeline system, subject to the following:  (i) bi-directional flow must be available at the delivery and/or receipt  points to be utilized to provide Imbalance Management Services, and (ii) the Third Party Provider must have the ability to deliver gas to and receive gas from Transporter's pipeline system in order to provide a physical balancing service, i.e., a -papertransaction will not qualify as a Third Party imbalance management service;

(c) the method by which the Third Party Provider will give a timely notice of the nature and level of imbalance services to be provided by it to Shippers on Transporter's pipeline system on any given day;

(d) a certification by the Third Party Provider that, if applicable, its service will be provided pursuant to all applicable NAESB standards including without limitation time lines, notices and data sets;

(e) a copy of Third Party Provider's Imbalance Services Agreement with Transporter's Shipper; 

37.5  a Third Party Provider must agree to indemnify Transporter for any costs, expenses or liabilities which might arise or accrue against Transporter due to the imbalance management services provided by the Third Party Provider.

37.6  a Third Party Provider must agree to post a performance bond or other evidence of its ability to perform the imbalance services.

37.7  a Third Party Provider must execute with Transporter a Transportation or Storage Service Agreement as necessary to perform the Third Party Imbalance Management Service on Transporter's pipeline system.

37.8  To the event a Third Party Provider offers an imbalance management service which is subject to the Commission's jurisdiction the Third Party Provider must obtain the necessary Commission approval to provide the service (including, but not limited to, certification, tariff approval, established rates) prior to commencing imbalance management services for Shippers on Transporter's pipeline system.

37.9  In the event a Shipper purchases third party imbalance management services,the Third Party Provider fails in whole or in part to provide those services, and an imbalance results, to the extent of such failure Shipper will be deemed to have no imbalance management service and Shipper will pay Transporter a penalty in an amount pursuant to Sections 20, 21, 22, 23 of the General Terms and Conditions, plus any additional costs incurred by Transporter to provide the services.

10.  OPERATING INFORMATION, ESTIMATES, NOMINATION, SCHEDULING AND BALANCING

10.1  Shipper shall provide Transporter with all information and material required by Transporter to calculate and verify Shipper's Input Quantity and the quantity of gas taken by the quality specification and the components of both Shipper's Input Quantity and the quantities of gas taken by Shipper at the Delivery Point(s) each day.

10.2  At Transporter's request, any Shipper, which has executed a Gas Transportation Contract with Transporter wherein Transporter agrees to transport gas on behalf of Shipper, will furnish to Transporter estimates of the daily, monthly, and annual quantities of natural gas which Shipper desires Transporter to transport for Shipper.

10.3  At least ten (10) days prior to commencement of initial deliveries under an executed service agreement, Shipper shall furnish Transporter with a written estimate showing by Point(s) of Receipt and Point(s) of Delivery the estimated daily quantities of gas it desires Transporter to transport on its behalf during the first twelve (12) months of transportation service under the executed service agreement.

10.4  Nominations.  Shipper shall give notice by the Customer Activities Web site utilized by transporter, telephone, or telecopy to Transporter in which Shipper desires transportation service to be rendered by nominating under the applicable rate schedule the Dekatherms of gas Shipper desires to tender at the Point(s) of Receipt and Point(s) of Delivery for transportation during such next succeeding month.

Transporter shall advise Shipper as stated above, prior to the start of each day for which nominations are made, of the Dekatherms which Transporter will schedule and accept at the Point(s) of Receipt for transportation, and deliver at the Point(s) of Delivery after transportation, which quantity shall be scheduled the Dekatherms unless operating conditions require adjustment thereof.

Nominations received from Shippers for any day under Rate Schedule FTS shall be used to calculate the amount of capacity available for transportation under Rate Schedule ITS for such day. Transporter will evaluate all timely nominations in light of the estimated demand for firm service and will schedule interruptible service for such day up to the level of available capacity.  Prior to the start of the day for which interruptible nominations are made by a Shipper, Transporter will notify such Shipper(s) of the interruptible amount scheduled for delivery for such day.

(a) Transporter shall support the following standard nomination cycles (all times are CCT pursuant to NAESB WGQ Standard No. 0.3.17) [1.3.2]:



(i)  The Timely Nomination Cycle 

On the day prior to gas flow:

- 1:00 p.m. Nominations leave control of the Service Requester; 
- 1:15 p.m. Nominations are received by Transporter (including from Title Transfer Tracking Service Providers (TTTSPs)); 
- 1:30 p.m. Transporter sends the Quick Response to the Service Requester; 
- 4:30 p.m. Transporter receives completed confirmations from Confirming Parties;
- 5:00 p.m. Service Requester and Point Operator receive scheduled quantities from Transporter.

Scheduled quantities resulting from Timely Nominations shall be effective at the start of the next Gas Day.

(ii)  The Evening Nomination Cycle 

On the day prior to gas flow:

- 6:00 p.m. Nominations leave control of the Service Requester; 
- 6:15 p.m. Nominations are received by Transporter (including from TTTSPs); 
- 6:30 p.m. Transporter sends the Quick Response to the Service Requester; 
- 8:30 p.m. Transporter receives completed confirmations from Confirming Parties;
- 9:00 p.m. Transporter provides scheduled quantities to the affected Service Requester and Point Operator, including bumped parties (notice to bumped parties).  

Scheduled quantities resulting from Evening Nominations shall be effective at the start of the next Gas Day.

(iii)  The Intraday 1 Nomination Cycle

On the current Gas Day:

- 10:00 a.m. Nominations leave control of the Service Requester; 
- 10:15 a.m. Nominations are received by Transporter (including from TTTSPs); 
- 10:30 a.m. Transporter sends the Quick Response to the Service Requester; 
- 12:30 p.m. Transporter receives completed confirmations from Confirming Parties;
- 1:00 p.m. Transporter provides scheduled quantities to the affected Service Requester and Point Operator, including bumped parties (notice to bumped parties).  

Scheduled quantities resulting from Intraday 1 Nominations shall be effective at 2:00 p.m. on the current Gas Day.

(iv)  The Intraday 2 Nomination Cycle

On the current Gas Day:

- 2:30 p.m. Nominations leave control of the Service Requester;
- 2:45 p.m. Nominations are received by Transporter (including from TTTSPs);
- 3:00 p.m. Transporter sends the Quick Response to the Service Requester;
- 5:00 p.m. Transporter receives completed confirmations from Confirming Parties;
- 5:30 p.m. Transporter provides scheduled quantities to the affected Service Requester and Point Operator, including bumped parties (notice to bumped parties).

Scheduled quantities resulting from Intraday 2 Nominations shall be effective at 6:00 p.m. on the current Gas Day.

(v)  The Intraday 3 Nomination Cycle

On the current Gas Day:

- 7:00 p.m. Nominations leave control of the Service Requester; 
- 7:15 p.m. Nominations are received by Transporter (including from TTTSPs); 
- 7:30 p.m. Transporter sends the Quick Response to the Service Requester; 
- 9:30 p.m. Transporter receives completed confirmations from Confirming Parties;
- 10:00 p.m. Transporter provides scheduled quantities to the affected Service Requester and Point Operator.  

Scheduled quantities resulting from Intraday 3 Nominations shall be effective at 10:00 p.m. on the current Gas Day.  Bumping is not allowed during the Intraday 3 Nomination Cycle.

(vi)  For purposes of NAESB WGQ Standard No. 1.3.2 (ii), (iii), (iv), and (v), the word "provides" shall mean, for transmittals pursuant to NAESB WGQ Standards 1.4.x, receipt at the designated site, and for purposes of other forms of transmittal, it shall mean send or post.

10.5  Intraday nominations.  Transporter shall give scheduling priority to an intraday nomination submitted by a firm shipper over nominated and scheduled volumes for interruptible shippers.  Transporter shall provide the interruptible shipper with advance notice of any reduction resulting from an intraday nomination by a firm shipper.  Intraday bump notices shall indicate whether daily penalties will apply for the Gas Day for which quantities are reduced. [1.3.51]  

10.6  Fuel reimbursement.  (Refer to NAESB WGQ Standard Nos. 1.3.15, 1.3.16, 1.3.28-30.)

10.7  Pooling.  (Refer to NAESB WGQ Standard Nos. 1.3.17, 1.3.18, 1.3.64, and 1.3.71.)

10.8  Allocations and flowing gas procedures.  Pre-determined Allocation (PDA) data elements shall be standardized. [2.3.1]  List of allocation methodology types agreed upon:  Ranked, Pro Rata, Percentage, Swing, and Operator Provided Value. [2.3.16]

10.9  Balancing.  It is recognized that the Parties are unable to control exactly the quantity of gas received and delivered hereunder on any day and that the receipts and deliveries by Transporter may vary above or below the quantity scheduled on any day.  Such variations shall be kept to a minimum permitted by operating conditions and shall be balanced at the Point(s) of Receipt and/or Delivery as soon as practicable.  Upon termination of the service agreement, any then existing imbalance between receipts by Transporter from Shipper, less Shipper's Pro Rata Share of Company Used Gas and Unaccounted For Gas and Transporter's deliveries to Shipper or for Shipper's account, shall be brought into balance within sixty (60) days of the termination of the contract.  Transporter shall not be obligated to deliver to Shipper on any day a greater quantity of gas than it has received from Shipper on such day, reduced by Shipper's Pro Rata Share of any Company Used Gas and Unaccounted For Gas.

10.10  Transporter shall keep accurate records of the quantities of gas scheduled for transportation and any imbalances, which records shall be made available to Shipper at its request.

?30.  PROCEDURES TO INFORM SHIPPERS - INFORMATIONAL POSTINGS AND CUSTOMER ACTIVITIES WEB SITES

30.1  Inquiries related to the capacity at receipt points, on the mainlines, and/or at delivery points and whether such capacity is available directly from Transporter or by capacity release on Transporter's system should be directed to Transporter's Informational Postings Web site.

30.2  In accordance with NAESB WGQ Standard Nos. 4.3.22, 4.3.23, 4.3.24, 4.3.25, 4.3.26, 4.3.27, and 4.3.28, Transporter has established an Informational Postings Web site for use by any party, including Shippers and potential shippers.  The Informational Postings Web site is available on a nondiscriminatory basis to any party that has compatible equipment for electronic transmission of data, provided that such party agrees to comply with the procedures for access to and for use of the Informational Postings Web site.  

30.3  The Informational Postings Web site will, to the extent necessary, permit users to electronically download a file(s) from the Informational Postings Web site and split extremely large files into smaller files prior to such download.  Transporter will maintain and retain daily back-up records of the information displayed on the Informational Postings Web site for three (3) years and permit users to review those records, which will be archived and reasonably accessible.  Transporter will periodically purge transactions from current Informational Postings Web site files when transactions have been completed.  Information on the most recent entries will appear ahead of older information.

30.4  A user has the option to utilize the Informational Postings Web site for the purposes of (a) requesting service and tracking service agreements; (b) exercising its rights as an existing Shipper of Transporter pursuant to Section 32 of the General Terms and Conditions or submitting a bid as a potential shipper of Transporter under such article; or (c) participating in Transporter's capacity release program pursuant to Section 33 of the General Terms and Conditions.

30.5  Transporter shall inform, on a timely basis via the Informational Postings Web site, all interested persons about the availability of firm and interruptible capacity (a) at receipt points; (b) on each pipeline segment, and (c) at delivery points, and whether such capacity is available directly from the Transporter or indirectly from Transporter's capacity release program.  Transporter shall maintain both in written form and on its Informational Postings Web site a master receipt point list containing the following information for each pipeline segment.  Such information shall be updated promptly when additional pipeline segments or receipt points are added to the system.

(a) Name of Receipt Point;
(b) Meter number of receipt point;
(c) Location (legal description) of receipt point;
(d) Operator name and phone number to the extent available;
(e) Availability of electronic gas measurement;
(f) Receipt point design capacity; 
(g) Any firm capacity already assigned at the point;

30.6  Transporter shall comply with NAESB WGQ Quadrant Electronic Delivery Mechanism related standards:  4.3.1-3, 4.3.16-18, 4.3.20, 4.3.22-28, 4.3.30-36, 4.3.38, 4.3.40-50, 4.3.52-55, 4.3.57, 4.3.58, 4.3.66-69, 4.3.72, 4.3.75, 4.3.78-82, 4.3.85-87, 4.3.89-105, and NAESB WGQ Cybersecurity Related Standards 12.3.1, 12.3.2, and 12.3.12-25.  

30.7  Trading partner agreements and minimum sites shall be in accordance with NAESB WGQ Standard No. 12.3.9.  The roles of senders and receivers are defined as specified in NAESB WGQ Standard No. 12.3.12.  Security between Transporter and trading partners will adhere to NAESB WGQ Standard No. 12.3.13.  The Form of Electronic Data Interchange (EDI) Trading Partner Agreement is located on the Customer Activities Web site at www.oneok.com/okt.

30.8  Transporter, on the effective date of and pursuant to Section 33 of the General Terms and Conditions, will post on the Informational Postings Web site for a reasonable time the price, terms and conditions, and names of the parties to all capacity release and assignment agreements existing on that date.  All firm capacity holders who have executed such agreements prior to that date must provide such information to the Transporter for posting on the Informational Postings Web site.  Such posting is to make those agreements public and not to prompt potential shippers to submit a bid for such capacity.  

30.9  Transporter will provide access to an online, readonly copy of its currently effective FERC Gas Tariff, including the General Terms and Conditions via the Informational Postings Web site.

30.10  Any provisions of this FERC Gas Tariff requiring that these matters be written or in writing are satisfied by either Shipper or Transporter utilizing electronic transmission through the Informational Postings Web site in accordance with the procedures for utilization of the Informational Postings Web site when subsequently verified by a timely signed writing.  All other provisions requiring items or information to be written or in writing remain unchanged.

30.11  In order to access Transporter's Customer Activities Web site, Shipper must contact Transporter.  If requested, Transporter will provide the address, telephone number, and user fees of Transporter's Customer Activities Web site service provider.

30.12  Transporter is the exclusive proprietor of the Customer Activities Web site and of all the copyrights and proprietary interests therein, except insofar as any third party possesses a copyright or proprietary interest in such materials.  Shipper will not by virtue of this Article or the executed Customer Activities Web site Agreement acquire any proprietary interests in the Customer Activities Web site or its files.  Although Transporter is not the proprietor of certain data and information contained in the files of the Customer Activities Web site, Shipper will use the Customer Activities Web site for research purposes only and will not publish, broadcast, sell, or use any material received from the Customer Activities Web site in any manner of fashion that may infringe any copyrights or proprietary interests Transporter or any third party may have in the Customer Activities Web site and materials included therein.

30.13  Shipper assumes sole responsibility for all use of the Customer Activities and/or Informational Postings Web sites and hereby indemnifies and holds Transporter harmless against any liability or claim of any person that is attributed to improper use of the Customer Activities/Informational Postings Web sites by Shipper.  In no event will Transporter be liable to Shipper for consequential, exemplary, or special damages resulting, in whole or in part, from Shipper's use of the Customer Activities/Informational Postings Web sites.

30.14  Transporter's employees are not authorized to assist Shipper in framing a search request.  If, notwithstanding the foregoing, a Shipper requests and/or receives assistance from Transporter employees in framing a search request, such assistance will be at Shipper's risk and Transporter will not have any responsibility or liability arising therefrom.  For the purposes of this Article, "framing a search request" shall mean the process by which a Shipper identifies the research problem, selects the words, phrases, or numbers to be searched upon, and determines the relationship to each other of such words, phrases, and numbers and the order in which they are to be submitted.

30.15  Transporter warrants that, without the express consent of Shipper or as provided for in Section 32 or 33 of the General Terms and Conditions, no Transporter's employee or agent will disclose to any third party any information regarding research performed through the use of the Informational Postings Web site by Shipper.
